import React, {useState} from 'react'
import {Container, createMuiTheme, Grid, Paper, useMediaQuery} from '@material-ui/core'
import Breadcrumbs from "@material-ui/core/Breadcrumbs";
import Link from "@material-ui/core/Link";

import Home from "./Components/Home";
import Skills from "./Components/Skills";
import Project from "./Components/Project";

import {makeStyles} from "@material-ui/core/styles";
import CssBaseline from "@material-ui/core/CssBaseline";
import ThemeProvider from "@material-ui/styles/ThemeProvider";

import './App.css';

const useStyles = makeStyles((theme) => ({
    palette: {
        type: 'dark',
    },
    root: {
        flexGrow: 1,
    },
    directoryComponent: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
        backgroundColor: 'white',
    },
}));



export default function App() {
    const styles = useStyles();
    const [currentComponent, setCurrentComponent] = useState(<Home style={styles}/>);

    function changeCurrentComponent(event) {
        switch (event.target.innerText) {
            case 'Home':
                setCurrentComponent(<Home style={styles}/>);
                document.getElementById('Home').style.color = 'white';
                document.getElementById('Skills').style.color = 'gray';
                document.getElementById('Project').style.color = 'gray';
                break;

            case 'Skills':
                setCurrentComponent(<Skills style={styles}/>);
                document.getElementById('Home').style.color = 'gray';
                document.getElementById('Skills').style.color = 'white';
                document.getElementById('Project').style.color = 'gray';
                break;

            case 'Project':
                setCurrentComponent(<Project style={styles}/>);
                document.getElementById('Home').style.color = 'gray';
                document.getElementById('Skills').style.color = 'gray';
                document.getElementById('Project').style.color = 'white';
                break;

            default:
                setCurrentComponent(<Home/>);
                document.getElementById('Home').style.color = 'white';
                document.getElementById('Skills').style.color = 'darkgray';
                document.getElementById('Project').style.color = 'darkgray';
                break;
        }

    }

    const prefersDarkMode = useMediaQuery('(prefers-color-scheme: dark)');

    const theme = React.useMemo(
        () =>
            createMuiTheme({
                palette: {
                    type: prefersDarkMode ? 'dark' : 'light',
                },
            }),
        [prefersDarkMode],
    );


    return (
        <ThemeProvider theme={theme}>
            <CssBaseline/>
            <Container maxWidth={false}>
                <div className={styles.root}>
                    <Grid container spacing={3}>
                        <Grid item xs={12}>
                            <Breadcrumbs aria-label={"breadcrumb"} className={styles.directoryComponent}>
                                <Link color={'initial'} id={'Home'} onClick={changeCurrentComponent}>
                                    Home
                                </Link>
                                <Link color={'textSecondary'} id={'Skills'} onClick={changeCurrentComponent}>
                                    Skills
                                </Link>
                                <Link color={'inherit'} id={'Project'} onClick={changeCurrentComponent}>
                                    Project
                                </Link>
                            </Breadcrumbs>
                        </Grid>
                        <Grid item xs={12}>
                            {currentComponent}
                            <Grid item xs={12}>
                                <Paper className={styles.paper}>xs=12</Paper>
                            </Grid>
                            <Grid item xs={6}>
                                <Paper className={styles.paper}>xs=6</Paper>
                            </Grid>
                            <Grid item xs={6}>
                                <Paper className={styles.paper}>xs=6</Paper>
                            </Grid>
                            <Grid item xs={3}>
                                <Paper className={styles.paper}>xs=3</Paper>
                            </Grid>
                            <Grid item xs={3}>
                                <Paper className={styles.paper}>xs=3</Paper>
                            </Grid>
                            <Grid item xs={3}>
                                <Paper className={styles.paper}>xs=3</Paper>
                            </Grid>
                            <Grid item xs={3}>
                                <Paper className={styles.paper}>xs=3</Paper>
                            </Grid>
                        </Grid>
                    </Grid>
                </div>
            </Container>
        </ThemeProvider>


    );
}
